var title_f37_58_38819="Ultrasound depth selection";
var content_f37_58_38819=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F81876&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F81876&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Importance of proper ultrasound depth selection for vascular access",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 438px; height: 564px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Transverse ultrasound images of the right arm demonstrate the importance of proper image parameter selection. A) Poor image quality due to excessive depth (green arrow) and improperly positioned focal zone (asterisk). Note signal dropout in the lower half of the image, as the high frequency transducer cannot penetrate to 8 cm depth. B) Improved image quality with properly selected depth (green arrow) and focal zone (asterisk). There is now detailed resolution of the brachial artery (red arrow), paired brachial veins (blue arrows) and the biceps muscle. The humerus is also seen as a bright curved line deep to the vessels.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Lauren W Averill, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
