"   </a>",
"   .",
"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Baktai G, Szekely E, Marialigeti T, et al, &ldquo;Use of Midazolam (Dormicum) and Flumazenil (Anexate) in Paediatric Bronchology,&rdquo;",
"      <i>",
"       Curr Med Res Opin",
"      </i>",
