"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2694692",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Do not bathe, shower, or swim right after putting on.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2696254",
