"       </b>",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2694514",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Put patch on clean, dry, healthy skin. Move the site with each new patch.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2694736",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Do not place on breast.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2695146",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       If the patch falls off, put a new one on.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"link\">",
"        urn:lims:b498:s2705543",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       <b>",
"        <span style=\"text-decoration: underline\">",
"         Skin spray:",
"        </span>",
"       </b>",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2695545",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Prime pump by spraying it 3 times.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2695093",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Hold container upright and rest plastic cone flat on the skin while spraying.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2694501",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Put on clean, dry, healthy skin of the inner forearm. Start near the elbow.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2694492",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Use spray at the same time of day.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2694407",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Let dry before covering with clothing.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s3567482",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Do not rub into skin.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2694689",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Do not bathe, shower, or swim for 1 hour after putting on.",
"      </span>",
"     </li>",
