"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2694538",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Avoid fire, flames, or smoking until dry.",
"      </span>",
