"       </span>",
"      </span>",
"      <span class=\"content\">",
"       <b>",
"        <span style=\"text-decoration: underline\">",
"         Vaginal ring:",
"        </span>",
"       </b>",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2695236",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Put into the vagina and leave in place for 90 days.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2694870",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Follow how to use as you have been told by your doctor or read the package insert.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2695580",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Take out ring at the start of the 13th week.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2695226",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Put in a new ring.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2696134",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       To use, wash your hands and take ring from the pouch.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2695540",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Press sides of ring at the same time between thumb and index finger and put folded ring into the vagina.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2695506",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Perfect placement is not needed for the ring to work. The ring will not hurt.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2696146",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       To take off, hook your index finger around the rim or hold rim between index finger and middle finger and pull out.",
"      </span>",
"     </li>",
"     <li class=\"statement\">",
"      <span class=\"attributes\" style=\"display:none;\">",
"       <span class=\"entity\">",
"        &bull;",
"       </span>",
"       <span class=\"link\">",
"        urn:lims:b498:s2694778",
"       </span>",
"      </span>",
"      <span class=\"content\">",
"       Do not throw the vaginal ring in the toilet.",
"      </span>",
"     </li>",
"    </ul>",
