var title_f37_58_38826="Disseminated granuloma annulare - annular lesions";
var content_f37_58_38826=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F71308%7EDERM%2F77002%7EDERM%2F51459%7EDERM%2F64223%7EDERM%2F53172%7EDERM%2F53898&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F71308%7EDERM%2F77002%7EDERM%2F51459%7EDERM%2F64223%7EDERM%2F53172%7EDERM%2F53898&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Disseminated granuloma annulare",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 346px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This 42 year-old patient with disseminated granuloma annulare presented with 200 annular lesions ranging from 5-25 mm in diameter on the arms, legs, and trunk.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Disseminated granuloma annulare",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 376px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This 55 year-old patient presented with disseminated granuloma annulare in a brightly erythematous annular and arcuate pattern demonstrating complete central clearing. Scores of similar lesions were present on the trunk and extremities sparing the face, palms, and soles.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Disseminated granuloma annulare",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 381px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This 60 year-old patient with disseminated granuloma annulare presented with hundreds of erythematous papules and plaques on the medial arms, medial thighs, and buttocks. None of the lesions showed central clearing.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Disseminated granuloma annulare",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 305px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A 64 year-old woman with disseminated granuloma annulare displays solitary papules and incomplete annular lesions composed of discrete papules at the periphery of the rings.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Disseminated granuloma annulare",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 316px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This 40 year-old patient presented with over 100 discrete 1-2 mm erythematous papules over the arms and legs with just a few similar lesions on the trunk.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Granuloma annulare",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 370px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This 30 year-old patient with disseminated granuloma annulare shows confluent annular lesions on the right dorsum foot with papules at the periphery and within the center of the patches. Similar patchy involvement was present on the legs, hands, arms, and buttocks.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
